import React, { Component } from 'react';
import './shopping.scss';

export default class Shopping extends Component {
	render() {
		return (
			<div className='shopping'>
				<header>
					<form id='shopping-form'>
						<input type='text' placeholder='Add Item' />
						<button>+</button>
					</form>
				</header>
				<footer></footer>
			</div>
		);
	}
}
